GetAcetanhydrideKineticsData1[] :=

	(* Kinetics data of the hydrolysis of acetanhydride in water generated with method 1: Absorption values are the maximum measured values around 1140 1/cm.

	   Returns:
	   {xyPair1, xyPair2, ...}
	   xyPair: {Time in min, Absorption at maximum around 1140 1/cm} *)

	Module[
    
		{
			absorptionValues,
			i,
			kineticsDataMethod1,
			maxAbsorptionValue,
			partialSpectrum,
			spectra,
			time
		},
		
		spectra = GetAcetanhydrideHydrolysisIRSpectra[];
		kineticsDataMethod1 = 
			Table[
				partialSpectrum = Select[spectra[[i]], (#[[1]] > 1100 && #[[1]] < 1200) & ];
				absorptionValues = partialSpectrum[[All, 2]];
				maxAbsorptionValue = Max[absorptionValues];
				time = (i - 1)*2.0;
				{time, maxAbsorptionValue},
   
				{i, 1, Length[spectra]}
			];

		Return[kineticsDataMethod1]
	];

GetAcetanhydrideKineticsData2[] :=

	(* Kinetics data of the hydrolysis of acetanhydride in water generated with method 2: 
	   Absorption values are corrected by background absorption with straight line between proximate minima.

	   Returns:
	   {xyPair1, xyPair2, ...}
	   xyPair: {Time in min, corrected absorption at maximum around 1140 1/cm} *)

	Module[
    
		{
			baselineValue,
			correctedMaxValue,
			curveFitInfo,
			errorOfAbsorption,
			kineticsDataMethod2,
			maximum,
			minimum1,
			minimum2,
			newPoint,
			partialSpectrum,
			oldPoint,
			reducedChisquare,
			roots,
			spectra,
			time
		},

		spectra = GetAcetanhydrideHydrolysisIRSpectra[];
		
		kineticsDataMethod2 = {};
		errorOfAbsorption = 0.0005;
		reducedChisquare = 1.0;
		
		Do[
			partialSpectrum = Select[spectra[[i]], (#[[1]] < 1220 && #[[1]] > 1060) & ];
  			curveFitInfo = CIP`CurveFit`FitCubicSplines[CIP`DataTransformation`AddErrorToXYData[partialSpectrum, errorOfAbsorption], reducedChisquare];
  
			roots = {};
  			oldPoint = {partialSpectrum[[1, 1]], CIP`CurveFit`CalculateDerivativeValue[1, partialSpectrum[[1, 1]], curveFitInfo]};

			Do[
				newPoint = {i, CIP`CurveFit`CalculateDerivativeValue[1, i, curveFitInfo]};
				If[oldPoint[[2]]*newPoint[[2]] <= 0,
					AppendTo[roots, x /. FindRoot[CIP`CurveFit`CalculateDerivativeValue[1, x, curveFitInfo], {x, oldPoint[[1]], newPoint[[1]]}]]
				];
   				oldPoint = newPoint,
   
				{i, partialSpectrum[[1, 1]], partialSpectrum[[Length[partialSpectrum], 1]], 1}
			];
  
			If[Length[roots] < 3, Break[]];
  
			minimum1 = {roots[[1]], CIP`CurveFit`CalculateFunctionValue[roots[[1]], curveFitInfo]};
			maximum = {roots[[2]], CIP`CurveFit`CalculateFunctionValue[roots[[2]], curveFitInfo]};
			minimum2 = {roots[[3]], CIP`CurveFit`CalculateFunctionValue[roots[[3]], curveFitInfo]};
			baselineValue = minimum1[[2]] + (minimum2[[2]] - minimum1[[2]])/(minimum2[[1]] - minimum1[[1]])*(maximum[[1]] - minimum1[[1]]);
  
			correctedMaxValue = maximum[[2]] - baselineValue;
  
			If[correctedMaxValue >= 0.0,
				time = (i - 1)*2.0;
				AppendTo[kineticsDataMethod2, {time, correctedMaxValue}]
			],
  
			{i, 1, Length[spectra]}
  		];		
		
		Return[kineticsDataMethod2]
	];

