GetSpiralsClassificationDataSet[

	(* Returns intertwined spirals classification data set.

	   H. Juill, J. B. Pollack, Co-evolving Intertwined Spirals, Proceedings of the 
	   Fifth Annual Conference on Evolutionary Programming, San Diego, CA, 
	   February 29 - March 2, 1996, MIT Press, 461-468.
	   B. Palncz, L. Vlgyesi, Support Vector Classifier via Mathematica, Periodica 
	   Polytechnica Civ. Eng 48 (1-2), 15-37, 2004.

	   Returns:
	   Intertwined spirals classification data set *)

	(* Number of points for a single spiral *)  
	numberOfSingleSpiralIoPairs_?IntegerQ

	] :=

	Module[
    
		{
			classificationDataSet,
			i
		},

		classificationDataSet = {};
		
		Do[
			input = {2.0*Cos[i]*Exp[i/10.0], 1.5*Sin[i]*Exp[i/10.0]};
			output = {1.0, 0.0};
			ioPair = {input, output};
			AppendTo[classificationDataSet, ioPair],
			
			{i, Pi, 3.5*Pi, 2.5*Pi/numberOfSingleSpiralIoPairs}
		];
		Do[
			input = {2.7*Cos[i]*Exp[i/10.0], 2.025*Sin[i]*Exp[i/10.0]};
			output = {0.0, 1.0};
			ioPair = {input, output};
			AppendTo[classificationDataSet, ioPair],
			
			{i, -Pi/2.0, 2.5*Pi, 3.0*Pi/numberOfSingleSpiralIoPairs}
		];
		    
    	Return[classificationDataSet]
	];

GetIrisFlowerClassificationDataSet[] :=

	(* Returns iris flower classification data data : Index 1-50 = Species 1, index 51-100 = Species 2, index 101-150 = Species 3
	   Species 1 : Iris setosa, Species 2 : Iris versicolor, Species 3 : Iris virginica
	   
	   R. A. Fisher, The Use of Multiple Measurements in Taxonomic Problems, Annals of Eugenics 7, 179-188, 1936.

	   Returns:
	   {IOPair1, ..., IOPair150}
	   IOPair : {Input, Output}
	   Input : {{Sepal Length[mm], Sepal Width[mm], Petal Length[mm], Petal Width[mm]}
	   Output : {0/1 Species 1, 0/1 Species 2, 0/1 Species 3}
	   IOPair1-IOPair50 = Species 1, IOPair51-IOPair100 = Species 2, IOPair101-IOPair150 = Species 3 *)

  
	Module[
    
		{
			i,
			irisFlowerInputsSpecies1,
			irisFlowerInputsSpecies2,
			irisFlowerInputsSpecies3,
      		irisFlowerDataSetSpecies1,
			irisFlowerDataSetSpecies2,
			irisFlowerDataSetSpecies3
		},
    
		(* Iris flower raw data : {Sepal Length[mm], Sepal Width[mm], Petal Length[mm], Petal Width[mm]} *)
		irisFlowerInputsSpecies1 = GetIrisFlowerInputsSpecies1[];
		irisFlowerInputsSpecies2 = GetIrisFlowerInputsSpecies2[];
		irisFlowerInputsSpecies3 = GetIrisFlowerInputsSpecies3[];
    
		(* Create input/output pairs for classification *)
		irisFlowerDataSetSpecies1 = Table[{irisFlowerInputsSpecies1[[i]], {1.0, 0.0, 0.0}}, {i, Length[irisFlowerInputsSpecies1]}];
		irisFlowerDataSetSpecies2 = Table[{irisFlowerInputsSpecies2[[i]], {0.0, 1.0, 0.0}}, {i, Length[irisFlowerInputsSpecies2]}];
		irisFlowerDataSetSpecies3 = Table[{irisFlowerInputsSpecies3[[i]], {0.0, 0.0, 1.0}}, {i, Length[irisFlowerInputsSpecies3]}];
    
		(* Return complete data set *)
		Return[
			Join[irisFlowerDataSetSpecies1, irisFlowerDataSetSpecies2, irisFlowerDataSetSpecies3]
		];
	];

